import { Fragment, useState } from "react";
import Input from "../UI/Input";
import Button from "../UI/Button";
import Classes from "./Test.module.css";
{
  ("smallbtn button3");
}
const RightPanel = (props) => {
  const { quiz, currentindex } = props;
  let btnprops;
  if (currentindex == 1) {
    btnprops = "smallbtn button3";
  } else {
    btnprops = "smallbtn button1";
  }
  return (
    <Fragment>
      <div style={{ display: "flex", flexWrap: "wrap" }}>
        {quiz.map((x, index) => {
          return <Button className={btnprops}>{index + 1} </Button>;
        })}
      </div>
    </Fragment>
  );
};

export default RightPanel;
